import React from "react";
import { Nav, NavItem } from "react-bootstrap";
import { LinkContainer } from "react-router-bootstrap";
import { NavLink } from "react-router-dom";

const Checkoutsteps = ({ step1, step2, step3, step4 }) => {
  return (
    <Nav className="justfy-content-center mb-4">
      <NavItem>
        {step1 ? (
          <LinkContainer to="/login">
            <NavLink>Sign In</NavLink>
          </LinkContainer>
        ) : (
          <NavLink aria-disabled>Sign In</NavLink>
        )}
      </NavItem>

      <NavItem>
        {step2 ? (
          <LinkContainer to="/shipping">
            <NavLink>Shipping</NavLink>
          </LinkContainer>
        ) : (
          <NavLink aria-disabled>Shipping</NavLink>
        )}
      </NavItem>

      <NavItem>
        {step3 ? (
          <LinkContainer to="/payment">
            <NavLink>Payment</NavLink>
          </LinkContainer>
        ) : (
          <NavLink aria-disabled>Payment</NavLink>
        )}
      </NavItem>

      <NavItem>
        {step4 ? (
          <LinkContainer to="/placeorder">
            <NavLink>Place Order</NavLink>
          </LinkContainer>
        ) : (
          <NavLink aria-disabled>Place Order</NavLink>
        )}
      </NavItem>
    </Nav>
  );
};

export default Checkoutsteps;
